import { Nav, NavLink } from "../components/NavBar";
import logoWhiteImg from '../assets/images/telzir-white.png'


export function AppPage (){
    return(
       <>
       <Nav>
           <NavLink to="/"> 
                <img src={logoWhiteImg} alt="" />
           </NavLink>
       </Nav>
       </>
    )
}
